// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function AboutMe() {
    return (
        // AboutMe Container.
        <>
            <div id="AboutMe">
                <div className="container-fluid text-center">
                    {/* My Profile Picture */}
                    <img id="iamshawn-profile2" className="img-thumbnail" alt="iamshawn2.jpg" src="../../assets/misc/iamshawn2.jpg" />
                    {/* About Me Context */}
                    <div id="AboutMeContext">
                        <p className="text-white lead">
                            I'm just a young developer with a passion for creation! Since my childhood, I've always been interested <br />
                            in what's going on behind the scenes of video games, computers, and of course, websites! After making my <br />
                            first "game" in Batch at the age of twelve I've been coding ever since. For the past few years I've <br />
                            fiddled with markup languages like HTML & CSS, worked in frameworks like Bootstrap, learned languages <br />
                            like JavaScript and libraries like jQuery all alongside experimenting with many other different <br />
                            languages and frameworks which have helped me do things I never thought I could ever do by myself. <br />
                            This website is a place for me to showcase the work I've done over the years, giving you a sneak  <br />
                            peak at everything I've accomplished as a developer! When I'm not being a developer, I'm usually <br />
                            either playing video games, hanging with friends, or on a good day, going out to eat, which is
                             one of my favorite things to do! <br />
                        </p>
                    </div>
                </div>
            </div>
        </>
    );
}

// Do export.
export default AboutMe;
